import { Container, Vetor, Periodo, VetorContainer } from "./Style";
import Vector from "../../imagens/VectorNavBar.jpg";


const ExtratoNavBar = () => (
    <Container>
        <Periodo>Julho de 2023</Periodo>
        <VetorContainer>
            <Vetor>
                <img src={Vector} />
            </Vetor>
        </VetorContainer>
    </Container>

);




export default ExtratoNavBar;
